// Elements
const uploadArea = document.getElementById('uploadArea');
const fileInput = document.getElementById('fileInput');
const fileInfo = document.getElementById('fileInfo');
const filePreview = document.getElementById('filePreview');
const fileName = document.getElementById('fileName');
const fileSize = document.getElementById('fileSize');
const removeBtn = document.getElementById('removeBtn');
const generateBtn = document.getElementById('generateBtn');
const loading = document.getElementById('loading');
const resultSection = document.getElementById('resultSection');
const resultCanvas = document.getElementById('resultCanvas');
const previewBtn = document.getElementById('previewBtn');
const downloadBtn = document.getElementById('downloadBtn');
const copyBtn = document.getElementById('copyBtn');
const contractAddress = document.getElementById('contractAddress');
const previewModal = document.getElementById('previewModal');
const modalOverlay = document.getElementById('modalOverlay');
const modalClose = document.getElementById('modalClose');
const modalImage = document.getElementById('modalImage');

// State
let uploadedFile = null;
let generatedImageData = null;
let backgroundImage = null;

// OPSI 1: Upload background sebagai base64 (Recommended untuk deployment)
// Ganti string di bawah dengan base64 dari background image Anda
// Cara convert: buka https://base64.guru/converter/encode/image
// Upload background, copy hasilnya, paste di bawah (ganti string kosong)
const BACKGROUND_BASE64 = 'data:image/webp;base64,'; // Paste base64 string di sini

// OPSI 2: Background image URL (untuk local testing)
const BACKGROUND_IMAGE_URL = 'background.png'; // Path file background

// Upload Area Click
uploadArea.addEventListener('click', () => {
    fileInput.click();
});

// Drag and Drop
uploadArea.addEventListener('dragover', (e) => {
    e.preventDefault();
    uploadArea.classList.add('dragover');
});

uploadArea.addEventListener('dragleave', () => {
    uploadArea.classList.remove('dragover');
});

uploadArea.addEventListener('drop', (e) => {
    e.preventDefault();
    uploadArea.classList.remove('dragover');
    
    const files = e.dataTransfer.files;
    if (files.length > 0) {
        handleFile(files[0]);
    }
});

// File Input Change
fileInput.addEventListener('change', (e) => {
    if (e.target.files.length > 0) {
        handleFile(e.target.files[0]);
    }
});

// Handle File
function handleFile(file) {
    // Validate file type
    if (!file.type.startsWith('image/')) {
        alert('Please upload an image file!');
        return;
    }

    // Validate file size (10MB)
    if (file.size > 10 * 1024 * 1024) {
        alert('File size must be less than 10MB!');
        return;
    }

    uploadedFile = file;

    // Show file info
    const reader = new FileReader();
    reader.onload = (e) => {
        filePreview.src = e.target.result;
        fileName.textContent = file.name;
        fileSize.textContent = formatFileSize(file.size);
        
        uploadArea.style.display = 'none';
        fileInfo.style.display = 'flex';
        generateBtn.disabled = false;
        
        // Hide result if exists
        resultSection.style.display = 'none';
    };
    reader.readAsDataURL(file);
}

// Remove File
removeBtn.addEventListener('click', () => {
    uploadedFile = null;
    fileInput.value = '';
    uploadArea.style.display = 'block';
    fileInfo.style.display = 'none';
    generateBtn.disabled = true;
    resultSection.style.display = 'none';
});

// Format File Size
function formatFileSize(bytes) {
    if (bytes === 0) return '0 Bytes';
    const k = 1024;
    const sizes = ['Bytes', 'KB', 'MB', 'GB'];
    const i = Math.floor(Math.log(bytes) / Math.log(k));
    return Math.round(bytes / Math.pow(k, i) * 100) / 100 + ' ' + sizes[i];
}

// Generate Image
generateBtn.addEventListener('click', async () => {
    if (!uploadedFile) return;
    
    // Check if background is loaded
    if (!backgroundImage) {
        alert('Background image not loaded yet. Please wait or refresh the page.');
        return;
    }

    // Show loading
    loading.style.display = 'block';
    resultSection.style.display = 'none';

    try {
        // Load user uploaded image
        const userImage = await loadImageFromFile(uploadedFile);

        // Create canvas
        const canvas = resultCanvas;
        const ctx = canvas.getContext('2d');

        // Set canvas size to background size
        canvas.width = backgroundImage.width;
        canvas.height = backgroundImage.height;

        // Draw background
        ctx.drawImage(backgroundImage, 0, 0);

        // Calculate user image size and position (centered)
        // Anda bisa mengatur posisi dan ukuran sesuai kebutuhan
        const maxWidth = backgroundImage.width * 0.6; // 60% of background width
        const maxHeight = backgroundImage.height * 0.6; // 60% of background height
        
        let userImgWidth = userImage.width;
        let userImgHeight = userImage.height;
        
        // Scale to fit
        const scale = Math.min(maxWidth / userImgWidth, maxHeight / userImgHeight);
        userImgWidth *= scale;
        userImgHeight *= scale;
        
        // Center position
        const x = (backgroundImage.width - userImgWidth) / 2;
        const y = (backgroundImage.height - userImgHeight) / 2;

        // Draw user image on top of background
        ctx.drawImage(userImage, x, y, userImgWidth, userImgHeight);

        // Store generated image
        generatedImageData = canvas.toDataURL('image/png');

        // Hide loading and show result
        setTimeout(() => {
            loading.style.display = 'none';
            resultSection.style.display = 'block';
        }, 1000);

    } catch (error) {
        console.error('Error generating image:', error);
        alert('Failed to generate image. Please try again.');
        loading.style.display = 'none';
    }
});

// Load Image from URL or Base64
function loadImage(src) {
    return new Promise((resolve, reject) => {
        const img = new Image();
        // Tidak set crossOrigin untuk menghindari CORS issue
        img.onload = () => resolve(img);
        img.onerror = (e) => {
            console.error('Failed to load image:', e);
            reject(new Error('Failed to load image'));
        };
        img.src = src;
    });
}

// Load Image from File
function loadImageFromFile(file) {
    return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.onload = (e) => {
            const img = new Image();
            img.onload = () => resolve(img);
            img.onerror = reject;
            img.src = e.target.result;
        };
        reader.onerror = reject;
        reader.readAsDataURL(file);
    });
}

// Preview Image
previewBtn.addEventListener('click', () => {
    if (generatedImageData) {
        modalImage.src = generatedImageData;
        previewModal.classList.add('active');
    }
});

// Close Modal
modalClose.addEventListener('click', () => {
    previewModal.classList.remove('active');
});

modalOverlay.addEventListener('click', () => {
    previewModal.classList.remove('active');
});

// Download Image
downloadBtn.addEventListener('click', () => {
    if (generatedImageData) {
        const link = document.createElement('a');
        link.download = `generated-image-${Date.now()}.png`;
        link.href = generatedImageData;
        link.click();
    }
});

// Copy Contract Address
copyBtn.addEventListener('click', async () => {
    try {
        await navigator.clipboard.writeText(contractAddress.textContent);
        
        // Visual feedback
        const originalText = copyBtn.innerHTML;
        copyBtn.innerHTML = `
            <svg width="16" height="16" viewBox="0 0 16 16" fill="none">
                <path d="M13.5 4.5L6 12L2.5 8.5" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
            </svg>
            Copied!
        `;
        
        setTimeout(() => {
            copyBtn.innerHTML = originalText;
        }, 2000);
    } catch (error) {
        console.error('Failed to copy:', error);
        alert('Failed to copy address');
    }
});

// Prevent modal content click from closing modal
document.querySelector('.modal-content').addEventListener('click', (e) => {
    e.stopPropagation();
});

// Preload background image saat halaman load
async function preloadBackground() {
    try {
        if (BACKGROUND_BASE64) {
            // Load dari base64
            backgroundImage = await loadImage(BACKGROUND_BASE64);
            console.log('Background loaded from base64');
        } else if (BACKGROUND_IMAGE_URL) {
            // Load dari URL
            backgroundImage = await loadImage(BACKGROUND_IMAGE_URL);
            console.log('Background loaded from URL');
        } else {
            console.error('No background source provided! Set BACKGROUND_BASE64 or BACKGROUND_IMAGE_URL');
            alert('Background image not configured. Please set background in script.js');
        }
    } catch (error) {
        console.error('Failed to load background:', error);
        alert('Failed to load background image. Please check the configuration in script.js');
    }
}

// Load background saat page ready
window.addEventListener('DOMContentLoaded', preloadBackground);